const { setMsg } = require("../action/action")
const { connect } = require("react-redux")
const { SignUp } = require("../component/SignUp")
const { RegisterUser } = require("../call/UserCall")


const MapStatetoProps=(state)=>{
    return{
        msg:state.msg
    }
}

const MapPropstoDispatch=(dispatch)=>{
    return{
        updateMsg:(msg)=>dispatch(setMsg(msg))
    }
}

const containSign=connect(MapStatetoProps)(SignUp);
export const containUserCall=connect(null,MapPropstoDispatch)(RegisterUser);


export default containSign;
